          <Route excat path="/general" element={<News key="general" pageSize={5} country={"in"} category={"general"} />} />
          <Route excat path="/health" element={<News key="health" pageSize={5} country={"in"} category={"health"} />} />
          <Route excat path="/science" element={<News key="science" pageSize={5} country={"in"} category={"science"} />} />
          <Route excat path="/sports" element={<News key="sports" pageSize={5} country={"in"} category={"sports"} />} />
          <Route excat path="/technology" element={<News key="technology" pageSize={5} country={"in"} category={"technology"} />} />
          <Route excat path="/temp" element={ <Temp/>} />
      </Routes>
      </div>
    );
  }
}
